import React from 'react';
import ProjectCard from './ProjectCard';

const SearchResults = ({ projects }) => (
    <div>
        {projects.map((project) => (
            <ProjectCard key={project._id} project={project} />
        ))}
    </div>
);

export default SearchResults;
